import PySimpleGUI as sg

def win():
    titleBarLogo = b''

    heading_frame = sg.Frame('',[
        [sg.Button('保存\n返回', key='save', font=('', 12),size=(8,2)),
         sg.T('\t'*3),
         sg.T('参数设置    '),
         sg.T('\t'*2),
         sg.Button('重置\n参数', key='reset', font=('', 12), size=(8, 2)),
         ]
    ], border_width=0,pad=(10,20))




    col1 = sg.Col([
        [sg.Button('工单生成文件夹：', key='excel-file', pad=(0,10))],
        # [sg.Button('BOM版本管理表：', key='BOM-file', pad=(0,10))],
        [sg.Button('配置数据表：', key='electronic-file', pad=(0,10))],
        # [sg.Button('电路工艺管理表：', key='manage-file', pad=(0,10))],
    ],)

    col2 = sg.Col([
        [sg.In('', size=(60, 1), font=('',12),key='excel-path', readonly=True, pad=(0,12))],
        # [sg.In('', size=(60, 1), font=('',12),key='BOM-path', readonly=True, pad=(0,12))],
        [sg.In('', size=(60, 1),  font=('',12),key='electronic-path', readonly=True, pad=(0,10))],
        # [sg.In('', size=(60, 1), font=('',12), key='manage-path', readonly=True, pad=(0,10))],
    ])

    info_frame = sg.Frame('', [

        [col1,col2],


    ], border_width=0)


    layout = [
        [heading_frame],
        [info_frame]
    ]

    window = sg.Window('配置窗口',layout,finalize=True, element_justification='center',grab_anywhere=True, icon=titleBarLogo
                       )

    return window
